import React from 'react'

const ProjectsComp = () => {
    const TitleStyle = {
        color: "#7fccbd",
        paddingTop: "20px",
        fontSize: "30pt",
        fontWeight: "normal",
        margin: "0px"
    }

  return (
    <div className="container dark-blue">
        <h1 style={TitleStyle}>Projects</h1>
    </div>
  )
}

export default ProjectsComp
